import React from "react";
import PostTd from "./PostTd";

interface PostItem {
  order: number;
  id: string;
  name: string;
  date: string;
  title: string;
  content: string;
}

interface PostTrProps {
  info: PostItem[];
  user_id: string;
}

const PostTr: React.FC<PostTrProps> = ({ info, user_id }) => {
  const post_data = () => {
    alert(user_id);
  };
  return (
    <tbody onClick={post_data}>
      {info.map((item) => (
        <PostTd key={item.id} item={item} user_id={user_id} />
      ))}
    </tbody>
  );
};

export default PostTr;
